package date12_4_23;

public class type_casting {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		
		double S= 123.56;
		int i = (int) S;
		System.out.println(i);
		
		String S1 = "2345";
		int n1=Integer.parseInt(S1);
		System.out.println(n1+5);
		
		
		float d = 134.34f;
		int n2 = (int) d;
		System.out.println(n2);
	}

}
